                        <path id="curve" fill="#f67521" d="M 800 300 Q 400 350 0 300 L 0 0 L 800 0 L 800 300 Z">
                        </path>
                    </svg>
                </div>

                <header>
                    <h3>Projects</h3>
                </header>

                <main>
                </main>

                <footer>
                    <small>Wish you luck, <a href="https://www.instagram.com/katyaklema/?hl=ru">Kate</a>.</small>
                </footer>
                </body>
        );
    }
}

export default Projects;
